import React, { useState, useCallback } from "react";
import { Navbar, Button, Modal, Form } from "react-bootstrap";

export default function Nav() {
  const [show, setShow] = useState(null);
  const [showRegister, setShowRegister] = useState(null);
  const [email, setEmail] = useState("");
  const [name, setName] = useState("");
  const [password, setPassord] = useState("");

  const loginFunc = useCallback((e) => {
    e.preventDefault();
    setShow(false);
  });

  const loginShow = () => {
    setShow(true);
  };

  const registerShow = () => {
    setShowRegister(true);
  };

  return (
    <div>
      <Navbar className="navBar">
        <div className="container">
          <Navbar.Brand href="/" className="navText">
            JoinMe<i class="fas fa-users"></i>
          </Navbar.Brand>
          <Form inline>
            <Button onClick={() => loginShow()}>Login</Button>
            <Button onClick={() => registerShow()}>Register</Button>
          </Form>
        </div>
      </Navbar>
      <Modal show={show}>
        <Modal.Header closeButton>Login Modal</Modal.Header>
        <Modal.Body>
          <Form onSubmit={() => loginFunc()}>
            <Button type="submit">Login</Button>
          </Form>
        </Modal.Body>
      </Modal>
      <Modal show={showRegister}>
        <Modal.Header closeButton>Register Modal</Modal.Header>
        <Modal.Body>
          <Form onSubmit={() => loginFunc()}>
            <Button type="submit">Register</Button>
          </Form>
        </Modal.Body>
      </Modal>
    </div>
  );
}
